import React from 'react';

import classes from './Task.module.css';

	const Task = (props) => {

		return(
				<li key={props.key} className={classes.task}>
					<input 
						type="checkbox" 
						onChange={() => props.checkboxHandler(props.key)} 
						checked={props.checked}/>
					{props.text}
				</li>
			)
	}

export default Task;
